頭の中に言葉が浮かべば

そうか　見せてくれてありがとう

楽しみにしてる

コーヒーゼリーの口溶けをゆっくり楽しみながら
鼻から抜ける香りと、喉越しの滑らかさを
ひとくちずつ味わう、硬そうに思えて
柔らかい、ゼリーは瞳の好物だった。
ミルクの甘みがコーヒーの苦味を優しく包む。

海星さんに　会いたいです

そうね　みんな同じことを思ってるよ

はい

